import React, {useEffect, useState} from "react";
import "./App.css";
import 'bootstrap/dist/css/bootstrap.min.css';
import {
    BrowserRouter,
    Route,
    Routes
  } from "react-router-dom";

import Home from "./pages/Home";


function App() {
    
    return (
        <div>
            <BrowserRouter>
                <Routes>
                    <Route index element={<Home/>}/>
                </Routes>
            </BrowserRouter>

        </div>
    );
}

export default App;
